}

.nav {
	display: flex;
	justify-content: space-between;
	padding-top: 25px;
	padding-bottom: 22px;
	margin: 0;
	list-style-type: none;
	line-height: 17px;

	&__link {
		color: $color-ds50;
		font-size: 14px;
		font-weight: 300;

		&--active {
			font-weight: bold;
			color: $color-ds75;
		}
	}

	&__link:hover {
		color: $color-ds50;
	}

	&__item {
		padding-right: 20px;
	}

}

.header-login {
	&__user {
		margin-top: 1px;
		padding-left: 31px;
		padding-bottom: 3px;
		padding-top: 3px;
		border-left: 1px solid $color-ds5;
		color: $color-ds50;
	}

	&__guest {
		display: flex;
		margin-top: -1px;
	}

	&__guest-login {
		margin-right: 21px;

		@media (max-width: 991.98px) {
			margin-right: 0;
			margin-bottom: 20px;
		}
	}
}

@media (max-width: 991.98px) {
	.nav {
		position: fixed;
		flex-direction: column;
		justify-content: center;
		align-items: center;
		top: 0;
		left: -100%;
		width: 70%;
		height: 100vh;
		padding: 20px 15px;
		background-color: rgba(0, 0, 0, 0.8);
		transition: 0.6s all;
		z-index: 2;

		&_active {
			left: 0;
		}

		&__item {
			padding-right: 0;
			border: none;
			margin: 10px;
			width: 100%;
			padding: 5px 0;
			text-align: center;


		}

		&__link {
			font-size: 20px;
			display: block;
			color: white;

		}

	}



	.header-login__guest {
		position: fixed;
		flex-direction: column;
		justify-content: flex-end;
		align-items: center;
		top: 0;
		left: -100%;
		width: 70%;
		height: 100vh;
		padding: 20px 15px;
		transition: 0.6s all;
		z-index: 2;


		&_active {
			left: 0;
		}
	}

	.hamburger {
		display: block;
		position: absolute;
		right: 16px;
		top: 30px;
		transform: translateY(-50%);
		width: 26px;
		height: 12px;

		span {
			display: block;
			height: 1.5px;
			width: 100%;
			background-color: $color-purple;
			margin-bottom: 4.5px;
			transition: 0.5s all;
		}

		&_active {
			span {
				margin-bottom: -2px;

				&:nth-child(1) {
					transform: translateY(3px) rotate(-45deg);
				}

				&:nth-child(2) {
					display: none;
				}

				&:nth-child(3) {
					transform: translateY(3px) rotate(45deg);
				}
			}
		}
	}
}

